  text:
    text: "<p>Hi, I'm Techno_JF. In my most major role, I am a map reviewer for <a\
      \ rel=\"nofollow\" class=\"external free\" href=\"http://www.unrealsp.org\"\
      >http://www.unrealsp.org</a> . My contributions to the wiki have gotten slim\
      \ because I am attempting to be a fan fiction author and a mapper as well, but\
      \ I still felt that I needed to keep a user page on the wiki that looks like\
      \ I care.</p>\n<p>Right now, my e-mail address is the primary means of getting\
      \ a hold of me:</p>\n<p>Email: <a rel=\"nofollow\" class=\"external text\" href=\"\
      mailto:harmonicbow@yahoo.com\">harmonicbow@yahoo.com</a><br /></p>\n<p>However,\
      \ people can also leave me messages by adding them to the end of this page,\
      \ especially if they are \"wiki-relevant\" messages.</p>\n<p>Right now, I'm\
      \ trying to work through the <a href=\"/Legacy:ScriptedPawn\" title=\"Legacy:ScriptedPawn\"\
      >ScriptedPawn</a> pages, because a few of them STILL haven't even been created.\
      \ However, other people who are thinking about editing these pages should know\
      \ that I have uploaded images for all of Unreal 1's monsters (all such images\
      \ begin with ScriptedPawn in the name).</p>\n<p><b>Gehn:</b> I saw on another\
      \ page that your working on Sweeney's reference. Any way I can help. I don't\
      \ know much about UScript but if its organization or converting to a acceptable\
      \ format then I think I could help. savepotatoes@msn.com</p>\n<p><b>GRAF1K:</b>\
